import React from "react";
import { Link } from "react-router-dom";
//import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
//import { faBars, faMagnifyingGlass, faAngleDown, faCartShopping } from '@fortawesome/free-solid-svg-icons';

export default function Footer() {
    return(
        <footer>
            <div>
                <Link className="BLACKOUT" to="/">tyra woden</Link>
            </div>
            <div>
                <ul>
                    <li><Link to="/">LinkedIn</Link></li>
                    <li><Link to="https://github.com/k4tttt" target="_blank" rel="noopener noreferrer">GitHub</Link></li>
                    <li><Link to="mailto: tyra.woden@gmail.com">tyra.woden@gmail.com</Link></li>
                </ul>
            </div>
        </footer>
    )
}
